  (302265609641, 'NEW Big Magic By Elizabeth Gilbert Audio CD Free Shipping', 'By Elizabeth Gilbert. Elizabeth Gilbert is the author of a short story collection, Pilgrims (a finalist for the PEN/Hemingway Award), a novel,Stern Men, and a book of non-fiction,The Last American Man (nominated for the National Book Award and a New York Times Notable Book for 2002).', '41.50', 1, 'New', ''),
  (361944024225, 'NEW Command Authority By Tom Clancy Audio CD Free Shipping', 'Since then Clancy has established himself as an undisputed master at blending exceptional realism and authenticity, intricate plotting and razor-sharp suspense. by Tom Clancy. When an old friend of the Ryans is poisoned by a radioactive agent, the trail leads to Russia.', '35.50', 3, 'New', ''),
  (272839871188, 'NEW Two Nights By Kathy Reichs Audio CD Free Shipping', 'With Kathy Reichs, the reader knows that they are in the hands of an expert. As a forensic anthropologist, 1 of only 82 forensic anthropologists ever certified by the American Board, Reichs'' real-life expertise has given her novels an authenticity that most other crime novelists would kill for.', '36.35', 3, 'New', ''),
  (302407443823, 'NEW Gone Girl By Gillian Flynn Audio CD Free Shipping', 'By Gillian Flynn. Gone Girl. Format:Audio CD. Under mounting pressure from the police and the media—as well as Amy’s fiercely doting parents—the town golden boy parades an endless series of lies, deceits, and inappropriate behavior.', '62.90', 7, 'New', ''),
  (361908980605, 'NEW Styxx By Sherrilyn Kenyon Audio CD Free Shipping', 'By Sherrilyn Kenyon. The most highly-anticipated novel in the Sherrilyn Kenyon''s Dark-Hunter series since Acheron is here-the unfogettable story of Styxx, Acheron''s twin brother and one of the most powerful beings on earth.', '35.50', 2, 'New', ''),
  (361952105289, 'NEW Rainbow Six By Tom Clancy Audio CD Free Shipping', 'By Tom Clancy. Rainbow Six is Tom Clancy''s most shocking story ever  and closer to reality than any government would care to admit. Rainbow Six. Their success could literally mean the end of life on this earth as we know it.', '41.50', 6, 'New', ''),
